INSERT INTO `halamanstatis` VALUES ('1', 'Perjanjian Pengguna', 'perjanjian-pengguna', '<p>Pendahuluan</p>\r\n\r\n<p>Selamat datang di BakulSolo.com. Dengan menggunakan blanja.com (mencakup blanja.com dan situs, layanan, dan piranti terkait), Anda menyetujui persyaratan berikut, termasuk hal yang berupa tautan, dengan prinsip umum untuk PT.Metraplasa. Jika Anda memiliki pertanyaan, silahkan menghubungi Layanan Pelanggan.Perjanjian ini berlaku secara efektif pada tanggal 30 Mei 2014 untuk pengguna sekarang dan setelah persetujuan ini, juga termasuk pengguna baru.</p>\r\n\r\n<p>Cakupan</p>\r\n\r\n<p>Sebelum Anda menjadi anggota dari blanja.com, Anda harus membaca dan menyetujui seluruh syarat dan ketentuan yang ada dan yang berkaitan dengan, Perjanjian Penggunaan dan Kebijakan Privasi blanja.com. Kami merekomendasikan saat Anda membaca Perjanjian Penggunaan, Anda juga mengakses dan membaca informasi yang disajikan berupa tautan. Dengan menerima Perjanjian Penggunaan ini, Anda menyetujui bahwa Perjanjian Penggunaan dan Kebijakan Privasi akan berlaku kapanpun Anda menggunakan situs dan layanan di blanja.com, atau saat Anda menggunakan piranti yang berhubungan/berkaitan dengan situs dan layanan di blanja.com. Jika Anda menggunakan situs blanja.com yang lain, Anda setuju untuk menerima Perjanjian Penggunaan dan Kebijakan Privasi yang berlaku pada situs tersebut. Perjanjian yang berlaku di berbagai domain dan sub-domain merupakan perjanjian yang tampak di bagian bawah di setiap situs. Beberapa situs, layanan, dan piranti blanja.com memiliki tambahan atau ketentuan lain yang disediakan untuk Anda saat menggunakan situs, layanan, ataupun peranti pada website tersebut.</p>\r\n', '2020-03-18', '', 'admin', '6', '09:38:01', 'Rabu');
INSERT INTO `halamanstatis` VALUES ('2', 'Kebijakan Privasi', 'kebijakan-privasi', '<p>Kebijakan ini menjelaskan pada Anda tentang bagaimana Kami menggunakan dan melindungi informasi pribadi Anda.</p>\r\n\r\n<p>Kebijakan Privasi ini menjelaskan bagaimana Kami menangani informasi pribadi Anda dalam pelayanan Kami di website blanja.com. Website blanja.com beserta konten dan website terkait lainnya dimanapun kebijakan ini ada pada bagian bawah halaman blanja.comDengan menyetujui Kebijakan Privasi dan Perjanjian Pengguna pada saat registrasi, Anda berarti menyetujui pengumpulan, penyimpanan, penggunaan dan pengungkapan informasi pribadi Anda seperti yang telah dijelaskan pada Kebijakan Privasi ini. Kebijakan Privasi ini mulai berlaku sejak penerimaan pengguna baru atau mulai berlaku pada tanggal 28 Juni 2013.</p>\r\n\r\n<p>Pengumpulan</p>\r\n\r\n<p>Anda dapat menelusuri situs Kami tanpa memberitahu Kami siapa Anda atau menyampaikan informasi pribadi apa pun tentang diri Anda. Sekali Anda memberi Kami informasi pribadi Anda, Anda tidak asing bagi Kami. Jika Anda memberikan informasi pribadi Anda, Anda setuju memindahkan dan menyimpan informasi tersebut dalam server Kami di Indonesia.Kami dapat mengumpulkan dan menyimpan informasi pribadi berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Alamat email, informasi kontak, dan (tergantung layanan yang digunakan) terkadang informasi keuangan, seperti kartu kredit atau nomor rekening bank;</li>\r\n	<li>Informasi transaksi berdasarkan aktivitas Anda di situs (seperti menawar, membeli, menjual barang dan konten yang Anda hasilkan atau yang berhubungan dengan akun Anda);</li>\r\n	<li>Biaya pengiriman, penagihan dan informasi lain yang Anda berikan untuk membeli atau mengirim barang;</li>\r\n	<li>Forum diskusi, obrolan/chating, penyelesaian perselisihan, korespondensi melalui situs, dan korespondensi yang dikirimkan kepada Kami;</li>\r\n	<li>Informasi profil seperti nama, alamat email, gambar profil dan ulang tahun dari layanan keaslian pihak ketiga seperti Facebook Connect;</li>\r\n</ul>\r\n', '2020-03-18', '', 'admin', '9', '09:38:51', 'Rabu');
