INSERT INTO `halamanstatis` VALUES ('3', 'Informasi Pendaftaran Sopir', 'informasi-pendaftaran-sopir', '<p><b>Persyaratan</b></p>\r\n<ul><li>Pendidikan min. SMA/SMK</li><li>Memiliki SIM C atau SIM A, Tergantung jenis kendaraan</li><li>Memiliki pengalaman sebagai sopir minimal 2 tahun</li><li>Hafal wilayah dan sekitarnya</li><li> Jujur, tekun, pekerja keras</li><li>Upload Scan <b>SIM, STNK dan KTP</b> pada Formulir Pendaftaran di Inputan <b>Lampiran File</b></li></ul><br>\r\n\r\n<p><b>Deskripsi Pekerjaan</b></p>\r\n<ul><li>Bertanggung jawab untuk melakukan pengiriman barang ke customer sesuai dengan surat jalan</li>\r\n<li>Bertanggung jawab atas kendaraan yang digunakan dalam melaksanakan tugas</li>\r\n<li>Siap Melakukan loading dan unloading barang ke Motor</li>\r\n<li>Mampu mengoperasikan dan terbiasa menggunakan Google Map</li></ul><br><p></p>', '2020-08-10', '', 'admin', '1', '14:02:00', 'Senin');
