INSERT INTO `rb_produk` VALUES ('18', '0', '10', '0', '0', 'Consina Expert Series Lunara Biru Gelap', 'consina-expert-series-lunara-biru-gelap', 'Unit', '700000', '720000', '759000', '500', 'tas.jpg', '1. Unrestrained and portable active stereo speaker\r\n2. Free from the confines of wires and chords\r\n3. 20 hours of portable capabilities\r\n4. Double-ended Coil Cord with 3.5mm Stereo Plugs Included\r\n5. 3/4? Dome Tweeters: 2X and 4? Woofer: 1X', '<h2>Produk Lokal, Rasa Internasional</h2>\r\n\r\n<p>Consina merupakan salah satu produk lokal yang lahir pada tahun 1994. Bagi Anda yang memiliki hobi mendaki gunung dan berkemah, tentunya merk Consina sudah melekat di telinga Anda. Semakin berkembangnya perusahaan ini, peminatnya semakin banyak. Produk-produk dari consina memiliki kualitas yang sangat bersaing karena dibuat dengan material-material kelas satu. Tidak hanya itu, fungsi dan desainnya tidak kalah dengan merk-merk dari luar negeri.&nbsp;</p>\r\n\r\n<h3>Menampung Keseharian Anda Sehari-hari</h3>\r\n\r\n<p>Kali ini consina mengeluarkan tas ransel dengan ukuran yang besar yang mampu menampung kebutuhan berpetualang Anda. Tidak hanya itu, tas ransel Consina Lunara hadir dengan dimensi ukuran 30 x 25 x 60 sehingga Anda mampu menampung barang bawaan hingga 20 sampai 40 liter. Walaupun tas ini diperuntukkan untuk kebutuhan bertualang, Anda dapat menggunakan tas ini untuk kegiatan sehari-hari Anda.</p>\r\n', 'admin', 'Y', 'jeans,kemeja,kaos,pria', null, '1', '2019-03-21 11:38:37');
