INSERT INTO `rb_produk` VALUES ('22', '0', '1', '0', '3', 'APPLE MacBook Pro - Space Gray - Intel Core i5 2.3GHz', 'apple-macbook-pro--space-gray--intel-core-i5-23ghz-121934', 'Unit', '19500000', '20000000', '22500000', '1200', 'a2.jpg', '1. Unrestrained and portable active stereo speaker\r\n2. Free from the confines of wires and chords\r\n3. 20 hours of portable capabilities\r\n4. Double-ended Coil Cord with 3.5mm Stereo Plugs Included\r\n5. 3/4? Dome Tweeters: 2X and 4? Woofer: 1X', '<h3>Spesifikasi Lebih Tinggi untuk Pacu Produktivitas</h3>\r\n\r\n<p>Apple MacBook Pro edisi terbaru hadir dengan dua pilihan ukuran layar yakni 13 Inch dan 15 Inch. Apple MacBook Pro memiliki fitur terbaru yang memudahkan Anda bekerja dengan mengganti jejeran tombol Function (F) dengan panel sentuh. Fitur bernama Touch Bar ini dapat mengganti tampilan menu di panel sentuh sesuai aplikasi yang Anda gunakan. Namun, jika Anda masih menginginkan versi MacBook tanpa Touch Bar, Apple juga menyediakan varian MacBook Pro 13 Inch tanpa Touch Bar. Jadi Anda masih menggunakan Keyboard dengan tombol F berbentuk fisik seperti Layout Keyboard Laptop konvensional. MacBook Pro tanpa Touch Bar membawa peningkatan performa dibanding pendahulunya. Hadir sebagai otak utama adalah Processor Dual-Core besutan Intel Core i5 berkecepatan 2.3 GHz yang terintegrasi dengan pengolah grafis Intel Iris Graphics 640. Dua buah Port Thunderbolt 3 dengan antarmuka USB-C bisa digunakan untuk transfer data, mengisi baterai, dan Output Display.</p>\r\n\r\n<h3>Dua Pilihan Ukuran MacBook Pro</h3>\r\n\r\n<p>2 model MacBook Pro layar 13 dan 15 Inch, dengan dan tanpa Touch Bar.</p>\r\n', '3', 'Y', 'hardware,laptop,elektronik', '65', '1', '2019-03-23 20:24:24');
INSERT INTO `rb_produk` VALUES ('23', '0', '1', '0', '3', 'HP Business EliteBook X360 1020 G2', 'hp-business-elitebook-x360-1020-g2-122012', 'Unit', '30520000', '31520000', '32520000', '1100', 'a4.jpg', '1. Unrestrained and portable active stereo speaker\r\n2. Free from the confines of wires and chords\r\n3. 20 hours of portable capabilities\r\n4. Double-ended Coil Cord with 3.5mm Stereo Plugs Included\r\n5. 3/4? Dome Tweeters: 2X and 4? Woofer: 1X', '<h3><strong>Ringan, Kuat, dan Bertenaga</strong></h3>\r\n\r\n<p>HP EliteBook x360 1020 G2 merupakan laptop yang diperuntukkan bagi pebisnis yang memerlukkan tidak hanya berMotoritas tinggi, namun juga bertenaga. Elitebook x360 1020 G2 didukung oleh prosesor Intel Core i7-7500U sehingga mampu menghadirkan performa yang sangat dapat diandalkan. Selain itu, laptop dengan layar 12.5 beresolusi Full HD ini sudah dilengkapi dengan SSD (Solid State Drive) sebagai media penyimpanan data sehingga kinerjanya semakin kencang. Tentu saja laptop ini memiliki bobot yang sangat ringan agar Anda dapat membawanya kemana saja.</p>\r\n\r\n<h3><strong>Empat Mode Untuk Segala Kebutuhan Bisnis</strong></h3>\r\n\r\n<p>EliteBook x360 1020 G@ hadir dengan beberapa mode yang didesain untuk kebutuhan Anda sehingga dapat menunjang produktivitas Anda. Mode-mode tersebut yaitu Mode Tent yang berbentuk seperti tenda yang sangat cocok untuk presentasi, Mode Tablet yang mentransformasikan laptop Anda menjadi sebuah tablet, Mode Media yang membawa Anda untuk merasakan pengalaman hiburan mendalam, dan yang terakhir adalah Mode Laptop.</p>', '3', 'Y', 'hardware,laptop,elektronik', '40', '1', '2019-03-24 10:09:20');
INSERT INTO `rb_produk` VALUES ('24', '0', '1', '0', '3', 'ACER Swift 7 (SF713-51) (Core i7-7Y75) - Gold', 'acer-swift-7-sf71351-core-i77y75--gold-122101', 'Unit', '20465000', '21465000', '22465000', '1100', 'a7.jpg', '1. Unrestrained and portable active stereo speaker\r\n2. Free from the confines of wires and chords\r\n3. 20 hours of portable capabilities\r\n4. Double-ended Coil Cord with 3.5mm Stereo Plugs Included\r\n5. 3/4? Dome Tweeters: 2X and 4? Woofer: 1X', '<h3><strong>5 Alasan Jitu Memilih Acer Swift 7</strong></h3>\r\n\r\n<p>Pasar ultrabook dunia diramaikan kehadiran Acer Swift 7 yang menjadi salah satu ultrabook paling tipis di dunia. Ketebalan laptop yang super tipis memang ditujukan untuk Anda yang punya Motoritas tinggi. Karena tipis dan ringan, saat dibawa-bawa Acer Swift 7 tidak akan terlalu menyiksa Anda. Berikut ini lima alasan kenapa Anda harus segera memiliki Acer Swift 7:</p>\r\n\r\n<h3>1) Laptop Paling Tipis di Dunia</h3>\r\n\r\n<p>Acer Swift 7 menjadi laptop paling tipis di dunia saat diluncurkan pertama kali pada awal Juli 2016. Ini sangat wajar karena ketebalan laptop satu ini hanya 0.39 inci. Pemilihan material berkualitas juga membuatnya sangat ringan. Perpaduan warna emas di bagian dalam dan hitam matte di luar menciptakan kesan elegan dan modern. Dengan memakai Acer Swift 7 tentu akan meningkatkan kepercayaan diri Anda.</p>\r\n\r\n<h3>2) Layar Sentuh Jernih Seluas 13 Inci</h3>\r\n\r\n<p>Konten layar yang Anda lihat jadi terlihat jernih berkat dukungan layar sentuh seluas 13.3 inci beresolusi Full HD. Teknologi Acer Color Intelligence mengatur gamma dan saturasi agar bisa menghasilkan warna lebih kaya. Acer Swift 7 juga menggunakan panel layar jenis IPS sehingga dari sudut mana pun Anda melihatnya, kontras dan warna layar tidak pudar. Tak usah khawatir layar tergores, karena sudah menggunakan kaca Corning Gorilla Glass yang 2 kali lebih kuat dari kaca biasa.</p>', '3', 'Y', 'hardware,laptop,elektronik', '107', '1', '2019-03-24 10:11:03');
