INSERT INTO `rb_produk` VALUES ('29', '0', '10', '0', '4', 'Koper anti Maling Conggih Sekali', 'koper-anti-maling-conggih-sekali', 'pcs', '450000', '0', '550000', '1500', 'foto_kopers.jpg', '1. Unrestrained and portable active stereo speaker\r\n2. Free from the confines of wires and chords\r\n3. 20 hours of portable capabilities\r\n4. Double-ended Coil Cord with 3.5mm Stereo Plugs Included\r\n5. 3/4? Dome Tweeters: 2X and 4? Woofer: 1X', '<p>Ngeri bukan ?? Kejadian ini mungkin sudah sering terjadi , mungkin pernah menimpa kita atau sanak saudara kita. Sungguh merugikan tapi tidak pernah ada tindak lanjut atau menjadi sorotan berita. Masalahnya apa ?<br><br>Kejadian pencurian bagasi tidak pernah tertangkap kamera sehingga saat kita klaim pun tidak membuahkan hasil apapun. Kurangnya barang bukti membuat kita tidak bisa melakukan laporan dan kita dianggap mengada ada.<br><br>Daripada bingung dan menjadi tenang untuk melakukan perjalanan, berikut ini asher-online.com akan memberikan tips agar koper travel Anda menjadi koper anti maling.</p>', 'udinn', 'Y', '', '39', '1', '2019-12-22 05:49:49');
INSERT INTO `rb_produk` VALUES ('40', '0', '6', '14', '1', 'Men Singelete - Baju Dalam Menarik', 'men-singelete--baju-dalam-menarik', 'pcs', '3000', '0', '5000', '50', 'baju_dalam7.jpg;baju_dalam15.jpg;baju_dalam25.jpg', 'Singlet Rider R226B Vest ini dirancang secara exclusive dengan bahan yang berkualitas untuk menjamin kenyaman dan ketahanan produk. Dengan desain yang sporty untuk menambah kepercayaan diri Anda.', 'Singlet Rider R226B Vest ini dirancang secara exclusive dengan bahan yang berkualitas untuk menjamin kenyaman dan ketahanan produk. Dengan desain yang sporty untuk menambah kepercayaan diri Anda.\r\n\r\nSinglet Rider R226B Vest berbahan ribbed cotton yang didesain form-fitting style dengan V-neckline, detail seamless sides, dan white list trimming di bagian samping.\r\n\r\nSinglet Rider R226B Vest anti bakteria yang dirancang melalui proses Shrunkenize ini membuat Anda bebas dari jamur dan bau tak sedap sekaligus menjadikannya nyaman dipakai dan tidak mudah melar.', '1', 'Y', '', '108', '1', '2020-07-17 13:58:53');
INSERT INTO `rb_produk` VALUES ('46', '18', '10', '0', '1', 'Consina Expert Series Lunara Biru Gelapp', 'consina-expert-series-lunara-biru-gelapp-104616', 'Unit', '710000', '720000', '759000', '500', 'tas1.jpg', 'Consina merupakan salah satu produk lokal yang lahir pada tahun 1994. Bagi Anda yang memiliki hobi mendaki gunung dan berkemah, tentunya merk Consina sudah melekat di telinga Anda. Semakin berkembangnya perusahaan ini, peminatnya semakin banyak. ', '<h2>Produk Lokal, Rasa Internasional</h2>\r\n\r\n<p>Consina merupakan salah satu produk lokal yang lahir pada tahun 1994. Bagi Anda yang memiliki hobi mendaki gunung dan berkemah, tentunya merk Consina sudah melekat di telinga Anda. Semakin berkembangnya perusahaan ini, peminatnya semakin banyak. Produk-produk dari consina memiliki kualitas yang sangat bersaing karena dibuat dengan material-material kelas satu. Tidak hanya itu, fungsi dan desainnya tidak kalah dengan merk-merk dari luar negeri.</p>\r\n\r\n<h3>Menampung Keseharian Anda Sehari-hari</h3>\r\n\r\n<p>Kali ini consina mengeluarkan tas ransel dengan ukuran yang besar yang mampu menampung kebutuhan berpetualang Anda. Tidak hanya itu, tas ransel Consina Lunara hadir dengan dimensi ukuran 30 x 25 x 60 sehingga Anda mampu menampung barang bawaan hingga 20 sampai 40 liter. Walaupun tas ini diperuntukkan untuk kebutuhan bertualang, Anda dapat menggunakan tas ini untuk kegiatan sehari-hari Anda.</p>\r\n', '1', 'Y', 'muslimah,software,hardware,kaos,wanita', '19', '1', '2020-07-23 11:16:39');
