INSERT INTO `rb_pusat_bantuan_diskusi` VALUES ('6', '1', '0', 'Hai Toppers, Perkenalkan dengan Nata yang membantu cek kendala ini. Pembeli infokan barang \"Segitiga Instan Madeira - MDB5.3 Sunset (Qty. 1 x Rp 129,811) dan Segitiga Instan KEINA - KN54.38 Delfine Lilac\" rusak. Nata bantu cek dari bukti videonya terlihat benar barang memang rusak. \r\n\r\nMaka dari iu, kami arahkan solusi retur tukar barang untuk kendala ini. Silakan Penjual input alamat returnya dengan klik \"Konfirmasi Alamat Pengembalian\" kemudian pilih alamat.', null, 'admin', '2020-11-06 14:24:54', '1');
INSERT INTO `rb_pusat_bantuan_diskusi` VALUES ('12', '1', '0', 'Hai Toppers, Melanjutkan diskusi, Andrea cek kembali barang resi pengganti dengan nomor resi JP6830475349 (J&T), berikut status pengirimannya: 19 Nov 6:40 pm Paket sampai, diterima oleh Robby Prihandaya Berdasarkan status tracking, barang pengganti sudah diterima pada 19 Juni 2020. Silakan Pembeli berikan konfirmasinya, apakah sudah menerima barang penggantinya? \n\nJika barang sudah diterima dengan baik dan tidak ada kendala lain, silakan pembeli klik tombol \"Selesai / Batalkan Komplain\" agar kendala tertutup otomatis dengan solusi penerusan dana ke Saldo Penghasilan Penjual. Kami tunggu konfirmasi dari Pembeli dalam 2x24 jam hari kerja terhitung mundur dari sekarang. Jika Pembeli tidak berikan konfirmasi penerimaan barang, maka mohon maaf kami akan bantu tutup kendala ini dengan solusi penerusan dana ke Saldo Penghasilan Penjual.\n\nTerima kasih, Team Resolution Center', null, 'admin', '2020-11-07 10:12:29', '1');
